import { LOG_IN, LOG_OUT, FORGOT_PASSWORD } from './../constants/types';

const initialState = {};

export default function(state = initialState, action) {
    switch (action.type) {
        case LOG_IN:
            return {
                ...state
            };
        case LOG_OUT:
            return {
                ...state
            };
        case FORGOT_PASSWORD:
            return {
                ...state
            }
        default:
            return state;
    }
}
